@Override
protected long decode(BytesRef scratch, ByteArrayDataInput tmpInput) {
  tmpInput.reset(scratch.bytes);
  tmpInput.skipBytes(scratch.length - 4); // suggestion + separator
  scratch.length -= 5; // sep + long
  return tmpInput.readInt();
}

